import React from "react";

export const Landing = () => {
  return (
    <div className="row">
      <div className="col-10">
        <div className="home-wrapper ">
          <div className="img-text">
            Hi, I am <br /> <h1>Peace Akpai</h1> <br />I am a Full-Stack Web
            Developer
          </div>
        </div>
      </div>
    </div>
  );
};
export default Landing;
